const txnModule     	= require('../../TXNModule/txnModule');
const w_communication	= require('./utils.js');
/* ********************************************************************************* */ 


/* ********************************************************************************* */ 
module.exports = async function (transXpedia) {
	try{
		await txnModule.aps.creditCardPreInsurance.frameMessage.call(this,transXpedia);
		await w_communication.call(this,transXpedia);
		return await txnModule.aps.creditCardPreInsurance.extractMessage.call(this,transXpedia);
	} catch(e) {
			throw transXpedia;
	}
}
